import React from 'react';
import ButtonsBottom from '../components/ButtonsBottom';
import Logo from '../components/logo';
import Navigation from '../components/Navigation';
import Widget from '../components/Widget';

export const Presentation = () => {
    return (
        <main>
            <div className="widget">
                <Navigation />
                <Logo/>
                <Widget widgetNumber={0}/>
                <ButtonsBottom left={'/'} right={'/widget-2'} />
            </div>
        </main>
    )
}

export const Membres = () => {
    return (
        <main>
            <div className="widget">
                <Navigation />
                <Logo />
                <Widget widgetNumber={1}/>
                <ButtonsBottom left={'/widget-1'} right={'/widget-3'} />
            </div>
        </main>
    )
}

export const Planning = () => {
    return (
        <main>
            <div className="widget">
                <Navigation />
                <Logo />
                <Widget widgetNumber={2}/>
                <ButtonsBottom left={'/widget-2'} right={'/widget-4'} />
            </div>
        </main>
    )
}

export const Structure = () => {
    return (
        <main>
            <div className="widget">
                <Navigation />
                <Logo />
                <Widget widgetNumber={3}/>
                <ButtonsBottom left={'/widget-3'} right={'/widget-5'} />
            </div>
        </main>
    )
}
export const Sondages = () => {
    return (
        <main>
            <div className="widget">
                <Navigation />
                <Logo />
                <Widget widgetNumber={4}/>
                <ButtonsBottom left={'/widget-4'} right={'/contact'} />
            </div>
        </main>
    )
}

export default Widget1;
